empty_matrix = np.zeros([empty_len, empty_len])


def test_conversions():
    assert(convert_dotbracket_to_bp_list(sample_struct,
                                         allow_pseudoknots=False) == no_PK_bp_list)
    assert(convert_dotbracket_to_bp_list(
        sample_struct, allow_pseudoknots=True) == PK_bp_list)
    assert(convert_dotbracket_to_bp_list(empty_struct,
                                         allow_pseudoknots=False) == empty_bp_list)
    assert(convert_dotbracket_to_bp_list(
        empty_struct, allow_pseudoknots=True) == empty_bp_list)
    print("Passed: convert_dotbracket_to_bp_list")
    assert(convert_dotbracket_to_bp_dict(sample_struct,
                                         allow_pseudoknots=False) == no_PK_bp_dict)
    assert(convert_dotbracket_to_bp_dict(
        sample_struct, allow_pseudoknots=True) == PK_bp_dict)
    assert(convert_dotbracket_to_bp_dict(empty_struct,
                                         allow_pseudoknots=False) == empty_bp_dict)
    assert(convert_dotbracket_to_bp_dict(
        empty_struct, allow_pseudoknots=True) == empty_bp_dict)
    print("Passed: convert_dotbracket_to_bp_dict")
    assert(convert_dotbracket_to_matrix(sample_struct,
                                        allow_pseudoknots=False).tolist() == no_PK_matrix)
    assert(convert_dotbracket_to_matrix(sample_struct,
                                        allow_pseudoknots=True).tolist() == PK_matrix)
    assert(convert_dotbracket_to_matrix(empty_struct,
                                        allow_pseudoknots=False).tolist() == empty_matrix.tolist())
    assert(convert_dotbracket_to_matrix(empty_struct,
                                        allow_pseudoknots=True).tolist() == empty_matrix.tolist())
    print("Passed: convert_dotbracket_to_matrix")
    assert(sample_struct == convert_bp_list_to_dotbracket(
        PK_bp_list, len(sample_struct)))
    assert("".join([c if c in ["(", ")"] else "." for c in sample_struct])
           == convert_bp_list_to_dotbracket(no_PK_bp_list, len(sample_struct)))
    assert(empty_struct == convert_bp_list_to_dotbracket(
        empty_bp_list, len(empty_struct)))
    assert("".join([c if c in ["(", ")"] else "." for c in empty_struct])
           == convert_bp_list_to_dotbracket(empty_bp_list, len(empty_struct)))
    print("Passed: convert_bp_list_to_dotbracket")


if __name__ == '__main__':
    test_conversions()
